    <div className="App">
       <h1 style={{backgroundColor:"Blue",color:"red"}}>
         working on react
      </h1>
       <h2>Good Morning {greet()}</h2>
       <h3>Today : {" "+ new Date()}</h3>
       <h3>
        My Details : {person.firstname + " " + person.lastname }
       </h3>
    </div>
);
}

export default App;
